function insertValue(inputPath, value) {
    // If input path starts with '$.', remove it
    if (inputPath.startsWith('$.')) {
        inputPath = _.trimStart(inputPath, '$.');
    }

    if (inputPath.startsWith('roles')) {
        if (inputPath.includes('schemeName')) {
            schemeValueInsert(merge, inputPath, value, ['IC_TYPE', 'IC_NO']);
        } else {
            normalInsert(merge, inputPath, value);
        }
    } else if (inputPath.startsWith('parts')) {
        if (inputPath.includes('schemeName') || inputPath.includes('parts.areasOfInterest.areaOfInterest')) {
            var schemeNameOrder;
            if (inputPath.includes('salesChannel')) {
                schemeNameOrder = ['PARENT_CODE', 'DEALER_CODE', 'AGENT_ID', 'SOURCE_ID', 'MEPS_DEALER'];
            } else if (inputPath.includes('lineItem')) {
                schemeNameOrder = ['CATALOG_ID'];
            } else if (inputPath.includes('customerAccount')) {
                schemeNameOrder = ['ACCOUNT_NO'];
            } else if (inputPath.includes('areaOfInterest')) {
                schemeNameOrder = ['SERVICE_TYPE'];
            }

            schemeValueInsert(merge, inputPath, value, schemeNameOrder);
        } else {
            normalInsert(merge, inputPath, value);
        }
    } else if (inputPath.startsWith('relatedSalesLead')) {

        if (value != "") {
            if (inputPath.includes('schemeName')) {
                schemeValueInsert(merge, inputPath, value, ['SERVICE_NUMBER', 'EMAIL_ADDRESS']);
            } else {
                normalInsert(merge, inputPath, value);
            }
        }
    } else {
        normalInsert(merge, inputPath, value);
    }
}

